import React from 'react';
import Plot from 'react-plotly.js';

const DataPlot = (users, total_points) => {
    var y0 = total_points;
    
    var d1 = {
        y: y0,
        type: 'box'
    };

    var trace2 = {
        y: total_points,
        x:users,
        type: 'bar'
    };
    return (
        <Plot
          data={[d1, trace2]}
          layout={ {title: 'Plot'} }
        />
      );
}

export default DataPlot;
